Switch(
    ddAssetSearchType.Selected.assetType,
    "image",
    ClearCollect(
        assignAsset,
        Filter(
            xinet_images,
            Title = ThisItem.FILE_NAME
        )
    );
    If(
        CountRows(assignAsset) = 0,
        Collect(
            assignAsset,
            Patch(
                xinet_images,
                Defaults(xinet_images),
                {
                    Title: ThisItem.FILE_NAME,
                    fullpath: ThisItem.FILE_PATH,
                    macpath: ThisItem.FILE_PATH,
                    pcpath: ThisItem.FILE_PATH,
                    file_id: ThisItem.FILE_ID,
                    xinet_asset_type: {Value: ddAssetSearchType.Selected.assetType}

                }
            )
        )
    );
    Collect(
        colSelectedPageProductImages,
        {
            offerId: galSelectedOffers.Selected.ID,
            id: First(assignAsset).ID,
            title: Last(
                Split(
                    First(assignAsset).fullpath,
                    "/"
                )
            ).Value,
            thumbnails: "https://xinetapi.stjosephcontent.com/webnative/portalDI/?action=getimage&filetype=large&path=" & First(assignAsset).fullpath,
            selected: false,
            type: "image",
            lang: If(
                IsMatch(
                    First(assignAsset).Title,
                    "FR",
                    MatchOptions.Contains
                ),
                "fre",
                "eng"
            ),
            value: First(assignAsset).fullpath
        }
    );
    If(
        IsMatch(
            ThisItem.FILE_NAME,
            "FR",
            MatchOptions.Contains
        ),
        ClearCollect(
            assignAssets,
            galSelectedOffers.Selected.assigned_images_fre
        );
        Collect(
            assignAssets,
            {
                Id: First(assignAsset).ID,
                Value: First(assignAsset).fullpath
            }
        );
        Patch(
            colSelectedOffers,
            galSelectedOffers.Selected,
            {
                assigned_images_fre: assignAssets,
                updated: true
            }
        );
        ,
        ClearCollect(
            assignAssets,
            galSelectedOffers.Selected.assigned_images
        );
        Collect(
            assignAssets,
            {
                Id: First(assignAsset).ID,
                Value: First(assignAsset).fullpath
            }
        );
        Patch(
            colSelectedOffers,
            galSelectedOffers.Selected,
            {
                assigned_images: assignAssets,
                updated: true
            }
        );
    ),
    "logo",
    ClearCollect(
        assignAssetlogo,
        Filter(
            xinet_logos,
            Title = ThisItem.FILE_NAME
        )
    );
    If(
        CountRows(assignAssetlogo) = 0,
        Collect(
            assignAssetlogo,
            Patch(
                xinet_logos,
                Defaults(xinet_logos),
                {
                    Title: ThisItem.FILE_NAME,
                    fullpath: ThisItem.FILE_PATH,
                    macpath: ThisItem.FILE_PATH,
                    pcpath: ThisItem.FILE_PATH,
                    file_id: ThisItem.FILE_ID,
                    xinet_asset_type: {Value: ddAssetSearchType.Selected.assetType}
                }
            )
        )
    );
    Collect(
        colSelectedPageProductImages,
        {
            offerId: galSelectedOffers.Selected.ID,
            id: First(assignAssetlogo).ID,
            title: Last(
                Split(
                    First(assignAssetlogo).fullpath,
                    "/"
                )
            ).Value,
            thumbnails: "https://xinetapi.stjosephcontent.com/webnative/portalDI/?action=getimage&filetype=large&path=" & First(assignAssetlogo).fullpath,
            selected: false,
            type: "image",
            lang: Blank(),
            value: First(assignAssetlogo).fullpath
        }
    );
    ClearCollect(
        assignLogos,
        galSelectedOffers.Selected.assigned_logos
    );
    Collect(
        assignLogos,
        {
            Id: First(assignAssetlogo).ID,
            Value: First(assignAssetlogo).fullpath
        }
    );
    Patch(
        colSelectedOffers,
        galSelectedOffers.Selected,
        {
            assigned_logos: assignLogos,
            updated: true
        }
    );

);

